const initialState = {
  data: null
};

const reducer = (state = initialState, action) => {
  switch (action.type) {
    case 'INCREMENT_X':
      return {
        ...state,
        x: state.x + 1
      };
    case 'LOAD_DATA':
      return {
        ...state,
        data: action.payload
      };
    default:
      return state;
  }
};

export default reducer;
